import React, { useState } from 'react';
import "../src/css/contact.css";
import Navbar from "./components/navbar";
import Footer from "./components/footer";

export default function Contact() {
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    email: '',
    subject: '',
    message: ''
  });

  const [formErrors, setFormErrors] = useState({
    name: '',
    phone: '',
    email: '',
    subject: '',
    message: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const validateForm = () => {
    const errors = {};
    let isValid = true;

    // Basic validation example - you can customize it based on your requirements
    if (!formData.name.trim()) {

      isValid = false;
    }

    if (!formData.phone.trim()) {

      isValid = false;
    }

    if (!formData.email.trim()) {
      isValid = false;
    }

    if (!formData.subject.trim()) {
      isValid = false;
    }

    if (!formData.message.trim()) {
      errors.message = 'Message is required';
      isValid = false;
    }

    setFormErrors(errors);
    return isValid;
  };

  const getBorderColor = (field) => {
    return formErrors[field] ? 'red' : formData[field] ? 'green' : '';
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (validateForm()) {
      // Form is valid, submit the data or perform further actions
      // Example: You can use Formspree or any other service to handle form submission
      console.log('Form submitted:', formData);
    }
  };

  return (
    <>
      <Navbar />
      <main>
        <div id="formcontact">
          <form
            id="contactForm"
            onSubmit={handleSubmit}
            action="https://formspree.io/f/xwkdywrd"
            method="POST"
            name="myform"
          >
            <div className="containercont">
              <h1>Reach Out to Us. </h1>
              <h1>We Are Just a Message Away!</h1>
              <br />
              <div className="contact-box">
                <div className="contact">
                  <h2>Write Your Request</h2>
                  <br />
                  <label htmlFor="name">Name:</label>
                  <input
                    type="text"
                    id="name"
                    name="name"
                    onChange={handleChange}
                    style={{ borderColor: getBorderColor('name') }}
                  />
                  <span id="nameError" className="error-message">{formErrors.name}</span>
                  <label htmlFor="phone">Phone:</label>
                  <input
                    id="phone"
                    type="text"
                    name="phone"
                    onChange={handleChange}
                    placeholder="000 000 0000"
                    style={{ borderColor: getBorderColor('phone') }}
                  />
                  <span id="phoneError" className="error-message">{formErrors.phone}</span>
                  <label htmlFor="email">Email:</label>
                  <input
                    type="email"
                    id="email"
                    name="email"
                    onChange={handleChange}
                    style={{ borderColor: getBorderColor('email') }}
                  />
                  <span id="emailError" className="error-message">{formErrors.email}</span>
                  <label>Subject:</label>
                  <input
                    type="text"
                    name="subject"
                    onChange={handleChange}
                    style={{ borderColor: getBorderColor('subject') }}
                  />
                  <span id="subjectError" className="error-message">{formErrors.subject}</span>
                  <label htmlFor="message">Message:</label>
                  <textarea
                    id="message"
                    name="message"
                    onChange={handleChange}
                    rows={4}
                    style={{ borderColor: getBorderColor('message') }}
                    defaultValue={""}
                  />
                  <span id="messageError" className="error-message">{formErrors.message}</span>
                  <button className="send" id="contact" type="Submit">
                    SEND
                  </button>
                </div>
              </div>
            </div>
          </form>
        </div>
      </main>
      <Footer />
    </>
  );
}




